package de.griefed.serverpackcreator.app.gui.splash

import de.griefed.serverpackcreator.app.gui.utilities.ImageUtilities
import javax.swing.ImageIcon
import kotlin.random.Random

/**
 * Splash images to use as the background in the splashscreen.
 *
 * @author Griefed
 */
class Splashes {
    private val splashWidth = 600
    private val splashHeight = 337
    @Suppress("SpellCheckingInspection")
    val splashOne = ImageUtilities.fromBase64(
        "",
        splashWidth,
        splashHeight,
    )
    val splashTwo = ImageUtilities.fromBase64(
        "",
        splashWidth,
        splashHeight,
    )
    val splashThree = ImageUtilities.fromBase64(
        "",
        splashWidth,
        splashHeight,
    )
    val splashes = arrayOf(splashOne, splashTwo, splashThree)
    val getRandomSplash: ImageIcon
        get() {
            return splashes[Random.nextInt(0, splashes.size)]
        }
}